import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const data = ["hello","world"];
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Click Me
        </a>
      </header>
      <div>{data}</div>

    </div>
  );
}

export default App;
